import Signin from "../components/Signin";
import styled from "styled-components";

const Columns = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  grid-gap: 20px;
`;

const SigninPage = props => (
  <Columns>
    <Signin />
  </Columns>
);

export default SigninPage;
